%[text] # Task 1
% a
a = -1;
b = 4;
N = 10;
a_1 = a+(b-a)*rand(N,1);

N = 10^4;
a_2 = a+(b-a)*rand(N,1);

% b
N = 10;
x_0 = 7.5;
std = 2;
b_1 = x_0 + std*randn(N,1);

N = 10^4;
b_2 = x_0 + std*randn(N,1);
S = summary(b_2) %[output:2181d853]

figure %[output:611aeacc]
hold on %[output:611aeacc]
subplot(2,2,1) %[output:611aeacc]
histogram(a_1) %[output:611aeacc]
subplot(2,2,2) %[output:611aeacc]
histogram(a_2) %[output:611aeacc]
subplot(2,2,3) %[output:611aeacc]
histogram(b_1) %[output:611aeacc]
subplot(2,2,4) %[output:611aeacc]
histogram(b_2) %[output:611aeacc]

%%
%[text] ## Task 2
p = [0.09, 0.57, 0.34];              
labels = ["great","not great","awful"];

N = 100;
a_1 = zeros(N,1);

for i = 1:N
    u = rand;               
    if u < p(1)
        a_1(i) = 1;
    elseif u < p(1) + p(2)
        a_1(i) = 2;
    else
        a_1(i) = 3;
    end
end

N = 5000;
a_2 = zeros(N,1);

for i = 1:N
    u = rand;               
    if u < p(1)
        a_2(i) = 1;
    elseif u < p(1) + p(2)
        a_2(i) = 2;
    else
        a_2(i) = 3;
    end
end

m = mean(a_2) %[output:1c75bf8c]

figure %[output:9e14ff3f]
hold on %[output:9e14ff3f]
subplot(2,1,1) %[output:9e14ff3f]
histogram(a_1, 'Normalization','probability') %[output:9e14ff3f]
subplot(2,1,2) %[output:9e14ff3f]
histogram(a_2, 'Normalization','probability') %[output:9e14ff3f]

