%[text] ## Task 3
lambda = 1.41;        
N = 10^5;             

U = rand(N,1);                    
Xa = -log(1 - U) / lambda;       
mean_xx_a = mean(Xa);                 

N = 500;
X0 = exprnd(1/lambda, N, 1);     
X0 = sort(X0);                   
F0 = (1:N)'/N;                    
U2 = rand(N,1);                   
Xb = interp1(F0, X0, U2, 'linear', 'extrap');  
mean_xx_b = mean(Xb);         %[output:73913633] %[output:4e811949] %[output:3a9807d5]

%%
%[text] ## Task 4
F = @(x) (exp(x) - exp(-x)) ./ (exp(x) + exp(-x));     % F_X(x)
Finv = @(u) 0.5*log((1+u)./(1-u));                     % F_X^-1(u) = atanh(u)

% PDF = F'(x) = 4*exp(-2x)./(1 + exp(-2x)).^2
f = @(x) 4*exp(-2*x) ./ (1 + exp(-2*x)).^2;

mu = integral(@(x) x .* f(x), 0, Inf); % mean
EX2 = integral(@(x) x.^2 .* f(x), 0, Inf); % variance
sigmasq = EX2 - mu^2 %[output:08481ec8]
sigma = sqrt(sigmasq);
Nsim = 1e5;
N_values = [1 4 16 64];

figure %[output:50b6dbf6]
for i = 1:length(N_values) %[output:group:1d6bb25a]
    N = N_values(i);

    % Generate N random variables using the inverse CDF method
    U = rand(Nsim, N);
    X = Finv(U);                  % transform uniform -> X distribution
    Xbar = mean(X, 2);            % mean for each simulation row

    % Standardize according to CLT
    Z = sqrt(N) * (Xbar - mu);

    subplot(2,2,i) %[output:50b6dbf6]
    histogram(Z, 'Normalization','pdf')
    hold on

    % Compare to normal N(0, sigma^2)
    z = linspace(min(Z), max(Z), 200);
    plot(z, normpdf(z, 0, sigma), 'r', 'LineWidth',1.5)
    title(['N = ' num2str(N)])
    xlabel('√N (X̄ - μ)')
    ylabel('density')
end %[output:group:1d6bb25a]

fprintf('μ ≈ %.4f,  σ² ≈ %.4f\n', mu, sigmasq); %[output:35cb8e25]



